import { Box, Typography } from '@mui/material';
import React from 'react';

const Rightbar=()=>{
    return(
        <Box sx={{backgroundColor:"red"}}  flex={2} p={2}>
            <Box position="fixed">
            <Typography>Online Friends</Typography>
            </Box>
        </Box>
    )
}
export default Rightbar
